import React from 'react';
import './Calendar.css';

function Calender() {
  return (
    <div>
      <div className='calendar-container'>
        <div className='calendar-inner-container'>
          <h2>Calender</h2>
          <div id='center-display'>
            <div className='month-header'>
              <div className='left-arrow'>

              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Calender
